import React from "react";
import "./CoinSpin.scss";

export default function CoinSpin() {
  return (
    <div class="coinspin">
      <div class="front"></div>
      <div class="front_b"></div>
      <div class="back"></div>
      <div class="back_b"></div>
    </div>
  );
}
